const Prescription = () => {
  return (
    <div className="prescription w-full h-full mt-5 p-4">
      <div className="prescription__card">
        <p className="text-4xl head-txt font-medium tracking-tight">
          29 Januvary 2021
        </p>
      </div>
    </div>
  );
};

export default Prescription;
